import React from "react";
import { Container } from "react-bootstrap";
import { useSelector } from "react-redux";

const TeamCalendar = () => {
    const awayMatches = useSelector((state) => state.tour?.calendar?.awayMatches)
    const homeMatches = useSelector((state) => state.tour?.calendar?.homeMatches)

    return (
        <Container className="mt-5">
            <h3 className="text-center bg-danger text-white">
                Lịch thi đấu đội
            </h3>
            {awayMatches.map((round) => round.matches.map((match) => {
                return (
                    <></>
                )
            }))}
        </Container>
    );
};

export default TeamCalendar;
